    def segment_length(segment):
        l, r = segment
        return r - l

    def segment_intersection_length(segments):
        if not segments:
            return 0

        l, r = segments[0]
        for i in range(1, len(segments)):
            l_next, r_next = segments[i]
            l = max(l, l_next)
            r = min(r, r_next)

            if r < l:
                return 0

        return r - l

    def max_intersection_length(segments):
        if len(segments) < 2:
            return 0

        max_length = 0
        for i in range(len(segments)):
            remaining_segments = segments[:i] + segments[i + 1:]
            length = segment_intersection_length(remaining_segments)
            max_length = max(max_length, length)

        return max_length

    n = int(stdin.splitlines()[0])
