    def find_previous_number(num: int) -> int:
        if num % 3 == 0:
            return num // 3
        else:
            return (num // 3) * 2

    def can_be_rearranged(sequence: list) -> bool:
        previous_num = sequence[0]
        for num in sequence[1:]:
            if find_previous_number(num) != previous_num:
                return False
            previous_num = num
        return True

    def rearrange_sequence(sequence: list) -> list:
        result = []
        for num in sequence:
            previous_num = result[-1] if result else 0
            while num != find_previous_number(previous_num):
                result.append(find_previous_number(previous_num))
                previous_num = result[-1]
            result.append(previous_num)
        return result

    while not can_be_rearranged(given_sequence):
        given_sequence = rearrange_sequence(given_sequence)

    return ' '.join(map(str, given_sequence))

