    def search(rows, cols, depth, remaining):
        if depth == K:
            return is_valid(rows, cols)
        if depth % 2 == 0:
            count = 0
            for i in range(1, H + 1):
                if i not in rows:
                    count += grid[i].count('#')
            for j in range(1, W + 1):
                if j not in cols:
                    count += sum(row[j] == '#' for row in grid)
            return count == remaining
        else:
            return any(search(rows + [i], cols, depth + 1, remaining - count_black_squares(rows, cols)) for i in range(1, H + 1))

    result = 0
    for i in range(H):
        for j in range(W):
            if grid[i][j] == '#':
                result += search([], [j + 1], 1, K - 1) + search([i + 1], [], 1, K - 1)
    return result

