    umbrellas = [list(map(int, line.split())) for line in input_data[n+1:]]

    def pick_up_umbrella(x):
        return min(filter(lambda umbrella: x >= umbrella[0], umbrellas), key=lambda umbrella: umbrella[1])

    def fatigue(x, umbrellas_carried):
        return sum(map(lambda umbrella: umbrella[1], umbrellas_carried))

    def can_reach(x):
        return any(map(lambda segment: x >= segment[0] and x < segment[1], rain_segments))

    def reachable_segments(x):
        return list(filter(lambda segment: x >= segment[0] and x < segment[1], rain_segments))

    def can_pick_up(x):
        return any(map(lambda umbrella: x == umbrella[0], umbrellas))

    def optimize(x, umbrellas_carried):
        if x == a:
            return fatigue(x, umbrellas_carried)

        if can_reach(x):
            min_fatigue = float('inf')
            for segment in reachable_segments(x):
                new_umbrellas_carried = list(umbrellas_carried)
                if not any(map(lambda umbrella: x >= umbrella[0], new_umbrellas_carried)):
                    new_umbrellas_carried.append(pick_up_umbrella(x))
                min_fatigue = min(min_fatigue, optimize(x+1, new_umbrellas_carried))
                if can_pick_up(x):
                    new_umbrellas_carried.remove(pick_up_umbrella(x))
            return min_fatigue
        else:
            return float('inf')

    result = optimize(0, [])
    return '-1' if result == float('inf') else str(result)


