class Graph:
    def __init__(self, vertices):
        self.vertices = vertices
        self.adj_matrix = [[0] * vertices for _ in range(vertices)]

    def add_edge(self, u, v, w):
        self.adj_matrix[u][v] = w

    def weight(self, u, v):
        return self.adj_matrix[u][v]

    def __str__(self):
        s = ""
        for i in range(self.vertices):
            for j in range(self.vertices):
                s += str(self.adj_matrix[i][j]) + " "
            s += "\n"
        return s


class MST:
    def __init__(self, graph):
        self.graph = graph
        self.parent = [-1] * graph.vertices
        self.rank = [0] * graph.vertices

    def find(self, u):
        if self.parent[u] == -1:
            return u
        if self.parent[u] == self.parent[self.parent[u]]:
            return u
        self.parent[u] = self.find(self.parent[u])
        return self.parent[u]

    def union(self, u, v):
        parent_u = self.find(u)
        parent_v = self.find(v)
        if parent_u == parent_v:
            return False
        if self.rank[parent_u] < self.rank[parent_v]:
            self.parent[parent_u] = parent_v
        elif self.rank[parent_u] > self.rank[parent_v]:
            self.parent[parent_v] = parent_u
        else:
            self.parent[parent_v] = parent_u
            self.rank[parent_u] += 1
        return True

    def cost(self):
        total_cost = 0
        for u in range(self.graph.vertices):
            for v in range(self.graph.vertices):
                if u != v and self.union(u, v):
                    total_cost += self.graph.weight(u, v)
        return total_cost

    def min_operations(self):
        visited = [False] * self.graph.vertices
        self.parent = [-1] * self.graph.vertices
        self.rank = [0] * self.graph.vertices

        def dfs(u, weight):
            visited[u] = True
            for v in range(self.graph.vertices):
                if not visited[v] and self.graph.weight(u, v) == weight:
                    if self.union(u, v):
                        dfs(v, weight + 1)

        for u in range(self.graph.vertices):
            for v in range(self.graph.vertices):
                if not visited[v] and self.graph.weight(u, v) == 1:
                    dfs(u, 1)
                    break

        return self.cost()

