    def is_visually_appealing(pattern: list) -> bool:
        for i in range(len(pattern) - 1):
            if pattern[i] - pattern[i + 1] > 1 or pattern[i] == pattern[i + 1]:
                return False
        return True

    def generate_patterns(S: int, stars: int, row: int, current_pattern: list, patterns: set) -> None:
        if stars == 0:
            if is_visually_appealing(current_pattern):
                patterns.add(tuple(current_pattern))
            return

        if row % 2 == 0:
            generate_patterns(S, stars - 1, row + 1, current_pattern, patterns)
            current_pattern.append(min(stars, S - (row // 2) * 2))
            generate_patterns(S, stars - 1, row + 1, current_pattern, patterns)
        else:
            generate_patterns(S, stars - 1, row + 1, current_pattern, patterns)
            current_pattern.append(min(stars, S - (row // 2) * 2))
            current_pattern.append(min(stars, S - (row // 2) * 2) + 1)
            generate_patterns(S, stars - 1, row + 1, current_pattern, patterns)

    patterns = set()
    generate_patterns(S, S, 1, [S], patterns)
    patterns = sorted(list(patterns), key=lambda x: (sum(x), x.index(S)))

    result = f"{S}:"
    for pattern in patterns:
        result += f"\n{sum(pattern)},{S - sum(pattern)}"

    return result

