    def escape(x: int, y: int, visited: set) -> bool:
        if (x, y) in visited or grid[x][y] == '1':
            return False
        visited.add((x, y))

        if x == 0 or x == N - 1 or y == 0 or y == M - 1:
            return True

        for direction in ['U', 'D', 'L', 'R']:
            if is_valid_move(x, y, direction):
                if escape(x + (1 if direction == 'U' else -1) if direction in ['U', 'D'] else x, y + (1 if direction == 'R' else -1) if direction in ['R', 'L'] else y, visited):
                    return True

        return False

    for x in range(N):
        for y in range(M):
            if grid[x][y] == 'S':
                start = (x, y)
                break

