        if canister > 0:
            balloons_filled[smallest_balloon] += canister
            balloons_capacity[smallest_balloon] -= canister

    # Calculate the maximum fraction
    max_fraction = 0
    for capacity, filled in zip(balloons_capacity, balloons_filled):
        if filled > 0:
            fraction = filled / capacity
            if fraction > max_fraction:
                max_fraction = fraction

