        return False

    def shortest_path_length(source, destination, art):
        visited = [[0 for _ in range(n)] for _ in range(n)]
        visited[source[0]][source[1]] = 1
        queue = [(source[0], source[1], 0)]
        while queue:
            x, y, dist = queue.pop(0)
            if (x, y) == destination:
                return dist
            for dx, dy in [(0, 1), (0, -1), (1, 0), (-1, 0)]:
                nx, ny = x + dx, y + dy
                if is_safe(nx, ny, visited) and art[nx][ny] != 0:
                    queue.append((nx, ny, dist + manhattan_distance(x, y, nx, ny)))
                    visited[nx][ny] = 1
        return -1

    source = (0, 0)
    destination = (n - 1, n - 1)
    return shortest_path_length(source, destination, art)

