            name, language, *intermediate_languages = line.split()
            character = {"name": name, "language": language, "intermediate_languages": intermediate_languages}
            characters.append(character)
        return N, characters

    def can_converse(character1: dict, character2: dict) -> bool:
        languages = [character1["language"], character2["language"]] + character1["intermediate_languages"] + character2["intermediate_languages"]
        return all(language in languages for language in character2["intermediate_languages"])

    def find_smallest_set_to_leave(characters: list) -> int:
        remaining_characters = set(characters)
        smallest_set_size = float("inf")
        while remaining_characters:
            current_set_size = len(remaining_characters)
            if current_set_size < smallest_set_size:
                smallest_set_size = current_set_size
            to_leave = remaining_characters.pop()
            for character in remaining_characters.copy():
                if can_converse(to_leave, character):
                    remaining_characters.remove(character)
            remaining_characters.add(to_leave)
        return smallest_set_size

    N, characters = read_input()
    smallest_set_size = find_smallest_set_to_leave(characters)
