    def is_valid(r, c):
        return 1 <= r <= N and 1 <= c <= N and board[r - 1][c - 1] != '#'

    def bfs(start_r, start_c):
        queue = [(start_r, start_c, 0)]
        visited = set()

        while queue:
            r, c, steps = queue.pop(0)

            if (r, c) == (1, 1):
                return steps

            for dr, dc in [(-2, -1), (-2, 1), (-1, -2), (-1, 2), (1, -2), (1, 2), (2, -1), (2, 1)]:
                r_next, c_next = r + dr, c + dc
                if is_valid(r_next, c_next) and (r_next, c_next) not in visited:
                    queue.append((r_next, c_next, steps + 1))
                    visited.add((r_next, c_next))

        return -1

    start_r, start_c = 1, 1
    for r in range(N):
        for c in range(N):
            if board[r][c] == 'K':
                start_r, start_c = r + 1, c + 1
                break

    steps = bfs(start_r, start_c)
    return str(steps) if steps != -1 else '-1'

